import React from 'react';
import './Impressum.css';

function impressum() {
  return (
    <div className='impressum'>
      <h1>Impressum</h1>
      <p>Angaben gemäß § 5 TMG</p>
      <p>Pauline Margossian</p>
      <p>Berlin, Deutschland</p>

    </div>
  );
}

export default impressum;
